INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(1, 4, 7, '3 Easy Ways To Make Your iPhone Faster', 'The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc,', '<p style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same <a href=\"file:///D:/Intern%20Project/Blog%20Site/katen/html/blog-single.html#\" style=\"color: rgb(254, 79, 112); transition: all 0.2s ease-in-out 0s;\">vocabulary</a>. The languages only differ in their grammar, their pronunciation and their most common words.</p><p style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">Everyone realizes why a new common language would be desirable: one could refuse to pay expensive translators. To achieve this, it <mark style=\"padding: 0.2em; background-color: rgb(252, 248, 227);\">would be</mark> necessary to have uniform.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"post-lg-2.jpg\" style=\"width: 740px;\"><span style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><br></span></p><p><span style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">The languages only differ in their grammar, their pronunciation and their most common words. Everyone realizes why a new common language would be desirable.</span></p><p><span style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"> </span><img src=\"data:image/jpeg;base64,\" data-filename=\"single-sm-1.jpg\" style=\"width: 296px;\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">One could refuse to pay expensive translators. To achieve this, it would be necessary to have uniform grammar, pronunciation and more common words.</span></p><p style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">If several languages coalesce, the grammar of the resulting language is more simple and regular than that of the individual languages. The new common language will be more simple and regular than the existing <a href=\"file:///D:/Intern%20Project/Blog%20Site/katen/html/blog-single.html#\" style=\"color: rgb(254, 79, 112); transition: all 0.2s ease-in-out 0s;\">European languages</a>. It will be as simple as Occidental; in fact, it will be Occidental.</p><p style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">A collection of textile samples lay spread out on the table - Samsa was a travelling salesman - and above it there hung a picture that he had recently cut out of an illustrated magazine and housed in a nice, gilded frame.</p>', 'I should be incapable of drawing a single stroke', '<ul style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><li style=\"list-style-type: circle;\">How about if I sleep a little bit</li><li style=\"list-style-type: circle;\">A collection of textile samples lay spread out</li><li style=\"list-style-type: circle;\">His many legs, pitifully thin compared with</li><li style=\"list-style-type: circle;\">He lay on his armour-like back</li><li style=\"list-style-type: circle;\">Gregor Samsa woke from troubled dreams</li></ul><p style=\"color: rgb(112, 122, 136); font-family: Roboto, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">To an English person, it will seem like simplified <a href=\"file:///D:/Intern%20Project/Blog%20Site/katen/html/blog-single.html#\" style=\"color: rgb(254, 79, 112); transition: all 0.2s ease-in-out 0s;\">English</a>, as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary.</p>', '3,8,15', '3_easy_ways_to_make_your_iphone_faster.jpg', '_easy_ways_to_make_y', 1, '2024-04-13 03:02:58', '2024-05-07 03:52:52');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(3, 4, 5, 'What’s Behind Bangladesh’s Invitation to the G20 Summit?', 'The G20 has invited Bangladesh to participate in its annual summit for the first time this year. Bangladesh’s growing economic.', '<p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">Last December, India took over the G20 presidency for 2023. India has invited Bangladesh along with Egypt, Mauritius, the Netherlands, Nigeria, Oman, Singapore, Spain and the United Arab Emirates (UAE) to the <a href=\"https://sdg.iisd.org/events/g20-leaders-summit-2023/\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"background-color: transparent; transition: all 0.5s ease-out 0s;\">G20 summit</a> which will meet September 9–10.</p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">India announced its goal during its G20 presidency as “<a href=\"https://www.thehindu.com/news/national/g7-business-group-endorses-indias-g20-theme-of-one-earth-one-family-one-future/article66799101.ece\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"background-color: transparent; transition: all 0.5s ease-out 0s;\">Vasudhaiva Kutumbakam</a>,” glossed in English as “One Earth, One Family, One Future.” On the surface, this seems like an agenda based on global inclusivity, but behind this are India’s far-reaching ambitions of solidifying its influence as a leader of the Global South and one of the rising powers in the world.</p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">The invitation of Bangladesh holds special importance as this is the first time the country will attend the summit and it is also the only South Asian country to be invited this year. India has also stated that it expects Bangladesh’s “<a href=\"https://bangladeshpost.net/posts/india-wants-bangladesh-s-active-role-in-g20-meetings-99622\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"background-color: transparent; transition: all 0.5s ease-out 0s;\">active participation</a>” in the G20 meetings to promote the issues of mutual interest in the global arena.</p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"images (1).jpeg\" style=\"width: 275px;\"></p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">Bangladesh was the <a href=\"https://databankfiles.worldbank.org/public/ddpext_download/GDP.pdf\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"transition: all 0.5s ease-out 0s;\">35th</a> largest economy in 2022, with a GDP size of $460 billion. Its economy has grown 5–7% each year over the last decade (with the exception of 2020, the year of the Covid pandemic). PwC <a href=\"https://www.pwc.com/gx/en/world-2050/assets/pwc-the-world-in-2050-full-report-feb-2017.pdf\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"transition: all 0.5s ease-out 0s;\">projects</a> Bangladesh be the 23rd-largest economy by 2050. Bangladesh has <a href=\"https://www.moneycontrol.com/news/business/economy/not-just-per-capita-gdp-bangladesh-outpaces-india-on-key-social-indicators-too-5982001.html\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"transition: all 0.5s ease-out 0s;\">passed up</a> its larger neighbor India in many social and economic indicators. It is no tiny nation, either; with a population of 160 million people and a rapidly developing economy, Bangladesh is a potential golden goose.</p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"images.jpeg\" style=\"width: 275px;\"></p><p style=\"margin-bottom: 1em; color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">Given both the lucrative opportunities for development and the <a href=\"https://www.interregional.com/en/strategic-hedging/\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"transition: all 0.5s ease-out 0s;\">increasing attention</a> paid to the Indo-Pacific region by powers like China and the US, it is in India’s best interest to adopt a “good neighbor policy” towards Bangladesh.<br></p>', 'Not only India has its eye on Bangladesh', '<p><span style=\"color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\">The US has also shown a keen interest in Bangladesh, but its policies are complicated by Washington’s ever-consistent need to interfere in the internal matters of others. On one hand, the US wants Bangladesh to </span><a href=\"https://www.dhakatribune.com/bangladesh/foreign-affairs/302543/us-wants-bangladesh-to-join-indo-pacific-strategy\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"background-color: rgb(255, 255, 255); transition: all 0.5s ease-out 0s; font-family: Cardo, serif; font-size: 22px;\">join</a><span style=\"color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\"> the Quadrilateral Security Dialogue to restrain China’s growing influence in the Indo-Pacific. On the other hand, has targeted Dhaka with </span><a href=\"https://www.benarnews.org/english/news/bengali/us-concerned-about-violence-against-media-04112023122051.html\" target=\"_blank\" rel=\"noreferrer noopener nofollow\" style=\"background-color: rgb(255, 255, 255); transition: all 0.5s ease-out 0s; font-family: Cardo, serif; font-size: 22px;\">accusations</a><span style=\"color: rgb(0, 0, 0); font-family: Cardo, serif; font-size: 22px; background-color: rgb(255, 255, 255);\"> about the security of its democracy. The growing frustration caused by incidents like this is pushing Bangladesh more towards China and India. Still, Bangladesh has not formally chosen sides yet.</span><br></p>', '21,23', 'whats_behind_bangladeshs_invitation_to_the_g20_summit.jpg', 'hats_behind_banglade', 1, '2024-04-13 03:30:40', '2024-04-19 03:20:45');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(4, 4, 1, 'brother, Stefon, should leave Buffalo!', 'The injured Dallas Cowboys defensive back made it clear watching Monday Night Football last night: his brother, Stefon, needs to get out of Buffalo ASAP!', '<p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">There is some MAJOR drama in Buffalo! The Bills offense is a shadow of itself in 2023 from external and internal stressors. Last night, QB Josh Allen and the hometown Bills struggled in a third loss in four weeks.</span></p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">This time to the often self-destructive Denver Broncos.</span></p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">But last night\'s game highlighted a growing concern amongst Buffalo fans.</span></p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\">Josh Allen is a turnover machine who tries to do too much. The frustration of the skill players is boiling over to the point that the offensive coordinator - Ken Dorsey - was fired. Head coach Sean McDermott finds himself firmly on the hot seat with his talented squad now 5-5.</span></p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"388d08e58208230ac812f7d6e969fe1f.jpg\" style=\"width: 301px;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\"><br></span></p><p style=\"padding: 0px; margin-right: 0px; margin-left: 0px; outline: 0px; color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: inherit; font-style: inherit;\"><span style=\"font-size: 20.8px;\">Those frustrations might boil over into more if his brother - Dallas Cowboys DB Trevon Diggs - has any idea what his brother is going through/feeling about the trajectory of the franchise.</span><br></span></p>', 'Stefon Diggs, especially, has been frustrated.', '<p><span style=\"color: rgb(51, 51, 51); font-family: \"Work Sans\", Arial, Helvetica, sans-serif; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Rumblings on social media suggest that we could see a split between Stefon Diggs and the Buffalo Bills similar to the one we saw with the Minnesota Vikings a few years ago.</span><br></p>', '17', 'brother_stefon_should_leave_buffalo.jpg', 'rother_stefon_should', 1, '2024-04-13 04:18:46', '2024-04-16 22:26:59');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(5, 4, 8, 'A tale of two polaos: Ilish and Kaju polao recipes', 'Dive into a culinary adventure that’s as rich in tradition as it is in taste, just in time for your Eid meal prep! First up,', '<p><span style=\"color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; font-size: 18px; background-color: rgb(255, 255, 255);\">Dive into a culinary adventure that\'s as rich in tradition as it is in taste, just in time for your Eid meal prep! First up, we\'ve got the Ilish Polao, a dish that\'s a love letter to the monsoon-fed rivers of Bangladesh, where the silver hilsa fish turns a simple meal into a feast for the senses. Then, we switch gears to the regal Kaju Polao, where each bite is a crunchy, nutty surprise that promises to add a dash of opulence to your dining table.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"daily-lifestyle-women-people-in-bangladesh-south-asian-2TCTH3A.jpg\" style=\"width: 1279.16px;\"><span style=\"color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; font-size: 18px; background-color: rgb(255, 255, 255);\"><br></span><br></p>', 'KAJU POLAO (CASHEW POLAO)', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: inherit; font-weight: 700; line-height: inherit;\">Ingredients</span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">2 tbsp oil</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">1 tsp ghee</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">500g aromatic rice, soaked and drained</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">200g cashews</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">1 cup chopped onions</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">1 bay leaf</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">2 green cardamom</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">2 cloves</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">2-inch cinnamon sticks</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">5 green chillies</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">1 tsp ginger-garlic paste</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">3 tbsp finely chopped coriander leaves</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.55556em; margin-left: 0px; padding: 0px; font-size: 18px; line-height: inherit; text-rendering: optimizelegibility; color: rgb(16, 24, 40); font-family: \"Noto Serif JP\", serif; background-color: rgb(255, 255, 255);\">Salt to taste</p>', '10,12,20', 'a_tale_of_two_polaos_ilish_and_kaju_polao_recipes.webp', '_tale_of_two_polaos_', 1, '2024-04-15 20:04:22', '2024-05-07 04:48:45');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(7, 7, 6, 'What? Another medical form to fill out?', 'You\'re in a doctor\'s office with a clipboard and a pile of medical forms on your lap. For the umpteenth time.', '<p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-right: 0px; margin-bottom: 0.5rem; margin-left: 0px; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\">In many cases, you do need to fill out medical history forms. That can be true even if you already have a digital record on file, known as an electronic medical record (EMR) or electronic health record (EHR).</p><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin: 1.25em 0px 0.5rem; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\">The reason for collecting new information could be due to a variety of reasons:</p><ul style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; list-style-position: initial; list-style-image: initial; margin: 1.25em 0px; padding: 0px 0px 0px 1.625em; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\"><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">The health care provider might want an update, since information like medications or new health problems can change over time, or you might have missing or inaccurate information in your record.</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">Different specialists need to know about different aspects of your health.</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">Your EMR at one provider\'s office might not be accessible to others because practices don\'t always have compatible computer software.</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">Some practices don\'t want to rely on records created by other practices. They may not trust that they\'re accurate.</li></ul><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"f9a75616-08d4-4686-a5cb-622154cbccea-thumb.jpg\" style=\"width: 550px;\"></p><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\"><br></p><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-right: 0px; margin-bottom: 0.5rem; margin-left: 0px; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\">Sometimes, leaving out certain details might not matter, depending on the purpose of your health visit. For example, your eye doctor doesn\'t need to know that you broke your wrist when you were 18, had the flu last year, or had three C-sections. But they should know which medicines and supplements you take, and whether you have certain health conditions such as diabetes or high blood pressure.</p><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin: 1.25em 0px 0.5rem; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\">Not sure what to leave in or out of your history? Dr. Salamon suggests that you at least focus on the big stuff: chronic symptoms and conditions that need ongoing treatment, medications and supplements you\'re taking, and your family medical history.</p><p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin: 1.25em 0px 0.5rem; color: rgb(30, 30, 30); font-family: \"Roboto Slab\", \"Times New Roman\", Times, serif; font-size: 16px;\">\"If you can, bring a copy of your medical history to all new doctor appointments. It could be written or printed from your patient portal or kept handy on a digital health app. That way, you\'ll have it handy if you need to fill out medical forms or if the physician asks you questions about your medical history during an appointment,\" Dr. Salamon advises.</p>', 'What are the most important details in your medical history?', '<p style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: