, vitamins, and any herbal remedies or complementary medicines you use</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">medication allergies</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">vaccination history</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">any screening tests you\'ve had, so they won\'t be prescribed unnecessarily</li><li style=\"border: 0px solid rgb(206, 206, 206); --tw-border-spacing-x: 0; --tw-border-spacing-y: 0; --tw-translate-x: 0; --tw-translate-y: 0; --tw-rotate: 0; --tw-skew-x: 0; --tw-skew-y: 0; --tw-scale-x: 1; --tw-scale-y: 1; --tw-pan-x: ; --tw-pan-y: ; --tw-pinch-zoom: ; --tw-scroll-snap-strictness: proximity; --tw-gradient-from-position: ; --tw-gradient-via-position: ; --tw-gradient-to-position: ; --tw-ordinal: ; --tw-slashed-zero: ; --tw-numeric-figure: ; --tw-numeric-spacing: ; --tw-numeric-fraction: ; --tw-ring-inset: ; --tw-ring-offset-width: 0px; --tw-ring-offset-color: #fff; --tw-ring-color: rgba(59,130,246,.5); --tw-ring-offset-shadow: 0 0 #0000; --tw-ring-shadow: 0 0 #0000; --tw-shadow: 0 0 #0000; --tw-shadow-colored: 0 0 #0000; --tw-blur: ; --tw-brightness: ; --tw-contrast: ; --tw-grayscale: ; --tw-hue-rotate: ; --tw-invert: ; --tw-saturate: ; --tw-sepia: ; --tw-drop-shadow: ; --tw-backdrop-blur: ; --tw-backdrop-brightness: ; --tw-backdrop-contrast: ; --tw-backdrop-grayscale: ; --tw-backdrop-hue-rotate: ; --tw-backdrop-invert: ; --tw-backdrop-opacity: ; --tw-backdrop-saturate: ; --tw-backdrop-sepia: ; margin-bottom: 0.5em; margin-top: 0.5em; padding-left: 0.375em;\">any metal implants you have, which could affect screenings.</li></ul>', '19,20', 'what_another_medical_form_to_fill_out.jpg', 'hat_another_medical_form_to_fi', 1, '2024-04-23 23:56:39', '2024-05-09 22:00:30');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(8, 7, 8, 'Key Components of Web Development.', 'Step into the digital realm where web development shapes our online experiences. In this blog, we’ll unravel the intricacies of coding', '<p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\">Step into the digital realm where web development shapes our online experiences. In this blog, we’ll unravel the intricacies of coding, design, and innovation that breathe life into websites and applications. From HTML and CSS to the dynamic world of JavaScript, join us on a journey through the evolving landscape of web development. Whether you’re a coding enthusiast or a business owner seeking a digital edge, this blog explores the challenges, trends, and innovations defining the future of web development. Fasten your seatbelts as we decode tomorrow’s technology today. Welcome to the world of web development.</p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(33, 37, 41);\">What is web development?</span></p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\">Web development is the process of creating and maintaining websites or web applications. It involves a combination of coding, programming, design, and content management to ensure the effective functioning and visual appeal of websites. Web development encompasses a broad spectrum, from simple static web pages to complex dynamic applications that allow user interaction.</p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(33, 37, 41);\">Key Components of Web Development:</span></p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"dev2.jpg\" style=\"width: 760px;\"></p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\">Front-End Development: This involves designing and implementing the user interface and user experience of a website. Technologies such as HTML, CSS, and JavaScript are commonly used to create visually engaging and interactive elements that users interact with directly.</p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(33, 37, 41);\">Back-End Development:</span> The back-end is the server side of web development responsible for managing databases, handling user authentication, and ensuring the overall functionality of the website or application. Common back-end languages include PHP, Python, Ruby, and Node.js.</p><p style=\"margin-bottom: 15px; font-size: 15px; line-height: 1.8; color: rgb(33, 33, 33); font-family: Rubik; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(33, 37, 41);\">Full-Stack Development:</span> Full-stack developers work on both the front-end and back-end of a website or application. They have a comprehensive understanding of the entire development process, making them versatile in creating end-to-end solutions.</p>', 'Content Management Systems (CMS', '<p><span style=\"color: rgb(33, 33, 33); font-family: Rubik; font-size: 15px; background-color: rgb(255, 255, 255);\">Web development is dynamic and continually evolving with emerging technologies and trends. It plays a crucial role in shaping the digital landscape, enabling businesses, organizations, and individuals to establish a powerful online presence and provide seamless user experiences. Whether creating a personal blog, an e-commerce platform, or a sophisticated web application, web development is the backbone that brings digital ideas to life on the World Wide Web.</span><br></p>', '9,15', 'key_components_of_web_development.jpg', 'ey_components_of_web_developme', 1, '2024-04-24 03:03:46', '2024-05-07 05:37:27');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(9, 7, 10, 'What is a Lifestyle Blog?', 'A lifestyle blog is a magazine-like website that shares and promotes daily life experiences and perspectives from an individual or group of like-minded people.', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">There are several creative ways to monetize a blog.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Most commonly, lifestyle blogs make money by advertising brands that align and resonate with the lifestyle they promote.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Lifestyle influencers (bloggers with large, engaged audiences) collaborate with brands through sponsor networks (like Activate or Social Fabric) and receive compensation for writing and publishing each sponsored post that reviews and recommends products to their readers.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Affiliate marketing arrangements with individual eCommerce programs and networks (like&nbsp;<a href=\"https://smartblogger.com/shareasale-review/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; transition: color 0.1s ease-in-out 0s, background-color 0.1s ease-in-out 0s;\">ShareASale</a>&nbsp;or&nbsp;<a href=\"https://www.rakuten.com/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; transition: color 0.1s ease-in-out 0s, background-color 0.1s ease-in-out 0s;\">Rakuten</a>) enable bloggers to receive sales commissions when readers purchase products through affiliate links embedded in their posts.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">We’ll note some additional strategies that a lifestyle blogger may employ to monetize their site in our featured list.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"lifestyle-blogs.jpg\" style=\"width: 900px;\"></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">The tagline for&nbsp;<a href=\"https://witanddelight.com/\" target=\"_blank\" rel=\"noopener\" style=\"box-sizing: inherit; transition: color 0.1s ease-in-out 0s, background-color 0.1s ease-in-out 0s;\">Wit &amp; Delight</a>, “Designing a life well-lived,” modestly describes the wide range of tangible and cerebral topics shared on this top lifestyle blog.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 1.4em; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Started in 2014 by blogger Kate Arends, this blog has blossomed into a one-stop women’s resource and guide for defining who they are, and how they want to live!</p>', 'The Skinny Confidential', '<p><span style=\"color: rgb(34, 34, 34); font-family: -apple-system, system-ui, BlinkMacSystemFont, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 20.8px; background-color: rgb(255, 255, 255);\">Blogger and self-proclaimed “oversharer” Lauryn Evars Bosstick doles out the dirt on lifestyle blog topics that more conservative bloggers may consider taboo, like manscaping, hangover tips, and talking to your kids about sex.</span><br></p>', '10,19,20', 'what_is_a_lifestyle_blog.jpg', 'hat_is_a_lifestyle_blog', 1, '2024-04-24 09:54:48', NULL);
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(10, 7, 9, 'Five Programs Every Young Coach Should Try', 'The curse of modernity is that we are increasingly populated by a class of people who are better at explaining than understanding, or better at explaining than doing.', '<p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">We are blessed to live in the information age, with virtually any bit of information at our fingertips. From countless CEU courses to hard drives filled with e-books, no coach is lacking in information. You can find numerous articles across the internet with Top 10 book lists, and these are all great resources—I have used many of them to fill my own bookshelf and CEU requirements. But I fear they may be incomplete.</p><p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">I have noticed a trend in young coaches having tremendous book knowledge of training but little understanding of how that training plays out. It’s one thing to know Prilepen’s chart, but a whole other thing to understand the training effects of 15 optimal reps between 80% and 90%. It’s one thing to understand the theory behind&nbsp;<a href=\"https://simplifaster.com/articles/top-accommodating-resistance-methods/\" style=\"box-sizing: inherit; background-color: transparent; transition: all 0.1s ease-in-out 0s; color: rgb(237, 72, 36); font-weight: 700;\">accommodating resistance</a>, it’s a whole other thing to understand just how quickly accommodating resistance can wreck a training session. Just like a martial arts master, we must not only know the concepts in theory, but in practice too.</p><p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"Westside.jpg\" style=\"width: 150px; float: left;\" class=\"note-float-left\">&nbsp;<span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">The following is a list of five programs I believe every young strength coach should run for a training cycle to experience the principles and concepts of these influential programs firsthand—each has a key takeaway that can be learned from running it</span><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">The following is a list of five programs I believe every young strength coach should run for a training cycle to experience the principles and concepts of these influential programs firsthand—each has a key takeaway that can be learned from running it. Some of these programs I found myself through reading, while others were introduced to me by mentors and others introduced to me through colleagues. So, without further ado, let’s jump in.</span></p><p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\"><br></span></p><p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\"><br></span></p><p style=\"box-sizing: inherit; padding: 0px; color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">The following is a list of five programs I believe every young strength coach should run for a training cycle to experience the principles and concepts of these influential programs firsthand—each has a key takeaway that can be learned from running it. Some of these programs I found myself through reading, while others were introduced to me by mentors and others introduced to me through colleagues. So, without further ado, let’s jump in.<span style=\"font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\"><br></span><br></p>', 'Love him or hate him, Mike Boyle is a leader', '<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">While not used by many today, the Tier System still stands out as a solid program and one which coaches can easily adapt for general-population clients on the side. Full body workouts with a template that’s easy to remember and won’t harm the client while mixing it up go along way with general population.</span><br></p>', '17,18', 'five_programs_every_young_coach_should_try.jpg', 'ive_programs_every_young_coach', 1, '2024-04-24 10:09:19', NULL);
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(11, 1, 4, 'There’s no better way to upgrade your style,', 'There’s no better way to upgrade your style, than to get inspired by sartorial fashionable gents, who are on top of their game.', '<p class=\"p1\" style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 22px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">Founded by Sven Raphael Schneider in 2010, Gentleman’s Gazette has gone from strength to strength through the years.</p><p style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 22px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">What stands out the most is the abundance of knowledge when it comes to classic men’s styles including “black tie”, “morning dress” and “white tie”, as well as the etiquette that comes with attending those formal occasions. </p><p class=\"p1\" style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">Besides the in-depth articles on classic menswear, Gentleman’s Gazette has also a very entertaining and insightful <a href=\"https://www.youtube.com/user/thegentlemansgazette\" target=\"_blank\" rel=\"noopener\" style=\"background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; color: rgb(84, 119, 155); cursor: pointer; box-shadow: none;\">YouTube channel</a>, which has recently surpassed 1M subscribers! Our favourite sections include: “Is it worth it?” as well as their videos on various dress codes.</p><p class=\"p1\" style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\"><img src=\"data:image/png;base64,\" data-filename=\"bfe03930f2a1bfff7515a14dc47d34d1.png\" style=\"width: 500px;\"></p><p style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 22px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">Antonio Centeno is a former United States Marine Corps Officer from West Texas, who noticed that the power of wearing a uniform can give you a sense of pride and respect for yourself. <br>Armed with this realisation, he decided to apply it every-day style.</p><p style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">He went on to study men’s style in London, Hong Kong, and Bangkok and founded RealMenRealStyle.com in 2008 – a successful blog and YouTube channel with over 3000 articles and videos on men’s style and the art of manliness. </p>', 'Founded in 2009 by Barron Cuadro,', '<p style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 22px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">His mission is to make Effortless Style into a great resource for guys to level up their style. </p><p class=\"p1\" style=\"background: 0px 0px rgb(255, 255, 255); border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(20, 20, 20); font-family: Arial, sans-serif; font-size: 16px;\">We particularly love his his smart-casual and business attire sections in the blog. His style tips are perfect for anyone who wants to use fashion to make a good impression at work, as well as a confidence booster in their everyday lives.</p>', '2,6', 'theres_no_better_way_to_upgrade_your_style.jpg', 'heres_no_better_way_to_upgrade', 1, '2024-04-24 22:42:10', '2024-04-27 23:59:18');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(12, 4, 8, 'The company completed a proof of concept', 'From the earliest stone tools to the latest advances in artificial intelligence, robotics, blockchains and virtual reality,', '<p style=\"margin: 10px 0px; padding: 0px; color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">1. Technology is about taking action to meet a human need rather than merely understanding the workings of the natural world, which is the goal of science. The invention of the microscope was driven by a need to explore the world of the small, beyond our unaided vision. This technological solution to a long standing problem has in turn enabled us to understand more the workings of the world which in turn has led to the development of more technologies.</p><p style=\"margin: 10px 0px; padding: 0px; color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">2. It uses much more than scientific knowledge and includes values as much as facts, practical craft knowledge as much as theoretical knowledge. The iPod is an example of where the physics of making a small device carry so much music is married with creative design to make an iconic must have accessory.</p><p style=\"margin: 10px 0px; padding: 0px; color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">3. It involves organised ways of doing things. It covers the intended and unintended interactions between products (machines, devices, artifacts) and the people and systems who make them, use them or are affected by them through various processes. Many people like to drink coffee, often in a coffee shop. That coffee may have come from trees which have been bred specifically for increased yields that support a small farmer and his family but that requires pesticides that were developed and manufactured in another country. The harvested coffee beans will themselves be transported around the world, to be processed and placed in packages which are distributed to shops that then make the cup of coffee in a polystyrene cup that was manufactured for the purpose but which then needs to disposed of and so on. Every choice we make relies on, and feeds, a highly interdependent and far reaching way of life where some have much and some have little.</p><p style=\"margin: 10px 0px; padding: 0px; color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"360_F_417289346_hrs0D4Lo8dSv3aWDqkQpRB0U9PbtFX6n.jpg\" style=\"width: 722px;\"></p><p style=\"margin: 10px 0px; padding: 0px; color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">Technology is a hands-on, can-do profession where people have to be skilled in many of the following: engineering, communicating, designing, developing, innovating, managing, manufacturing, modelling, and systems thinking. But technology also gives us various products which can be used for good or ill or where the benefits are disputed and similarly the processes involved in producing and using technology means that we should all take an interest in whether it provides us and everyone else with a sustainable future.<br></p>', 'Explore more technology articles', '<p><span style=\"color: rgb(29, 33, 37); font-family: arial, helvetica, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);\">Technology is a hands-on, can-do profession where people have to be skilled in many of the following: engineering, communicating, designing, developing, innovating, managing, manufacturing, modelling, and systems thinking. But technology also gives us various products which can be used for good or ill or where the benefits are disputed and similarly the processes involved in producing and using technology means that we should all take an interest in whether it provides us and everyone else with a sustainable future.</span><br></p>', '3,9,15', 'the_company_completed_a_proof-of-concept_demonstration.webp', 'he_company_completed_a_proof-o', 1, '2024-05-07 04:27:38', '2024-05-08 02:15:26');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(13, 4, 9, 'Crystal Palace 4-0 Manchester United | Premier League highlights', 'ANALYSIS\r\nCrystal Palace 4-0 Man Utd: Jamie Carragher says Erik ten Hag\'s side are one of the most poorly coached teams in the Premier League', '<p style=\"box-sizing: content-box; font-size: 22px; margin-right: auto; margin-bottom: 1.5rem; margin-left: auto; padding-top: 0px; padding-right: var(--site-gutter); padding-bottom: 0px; padding-left: var(--site-gutter); max-width: var(--article-body-width-l); transition: padding 0s ease-in-out 0s; word-break: break-word; font-weight: 700; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\">Jamie Carragher says Manchester United are \"one of the most poorly coached teams in the Premier League\" after their 4-0 defeat to Crystal Palace - and added that Casemiro should \"call it a day at the top level of football\".</p><p style=\"box-sizing: content-box; font-size: 22px; margin-right: auto; margin-bottom: 1.5rem; margin-left: auto; padding-top: 0px; padding-right: var(--site-gutter); padding-bottom: 0px; padding-left: var(--site-gutter); max-width: var(--article-body-width-l); transition: padding 0s ease-in-out 0s; word-break: break-word; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\">Erik ten Hag\'s side reached new depths in their well below-par season, falling 2-0 down at half-time to goals from Michael Olise and Jean-Philippe Mateta, before the former rounded off the scoring after Tyrick Mitchell found the net after the break.</p><div class=\"sdc-site-outbrain sdc-site-outbrain--AR_5\" aria-hidden=\"true\" data-component-name=\"sdc-site-outbrain\" data-target=\"\" data-widget-mapping=\"\" data-installation-keys=\"\" data-init=\"true\" style=\"font-size: 22px; margin-top: 0px; margin-right: 0px; margin-bottom: var(--group-margin); margin-left: 0px; padding: 0px; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\"><div class=\"OUTBRAIN\" data-src=\"https://www.skysports.com/football/news/11095/13130777/crystal-palace-4-0-man-utd-jamie-carragher-says-erik-ten-hag-s-side-are-one-of-the-most-poorly-coached-teams-in-the-premier-league\" data-ob-template=\"365MediaGroup\" data-widget-placement=\"\" data-widget-id=\"AR_5\" data-is-secured=\"true\" data-consent-string=\"\" data-consent-version=\"2\" style=\"margin: 0px; padding: 0px;\"></div></div><p style=\"box-sizing: content-box; font-size: 22px; margin-right: auto; margin-bottom: 1.5rem; margin-left: auto; padding-top: 0px; padding-right: var(--site-gutter); padding-bottom: 0px; padding-left: var(--site-gutter); max-width: var(--article-body-width-l); transition: padding 0s ease-in-out 0s; word-break: break-word; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\">United have now conceded 81 goals in all competitions this season, their most in a single campaign since 1977, as they run the risk of missing out on European football altogether next season.</p><p style=\"box-sizing: content-box; font-size: 22px; margin-right: auto; margin-bottom: 1.5rem; margin-left: auto; padding-top: 0px; padding-right: var(--site-gutter); padding-bottom: 0px; padding-left: var(--site-gutter); max-width: var(--article-body-width-l); transition: padding 0s ease-in-out 0s; word-break: break-word; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"images (3).jpeg\" style=\"width: 267px;\"></p><p style=\"box-sizing: content-box; font-size: 22px; margin-right: auto; margin-bottom: 1.5rem; margin-left: auto; padding-top: 0px; padding-right: var(--site-gutter); padding-bottom: 0px; padding-left: var(--site-gutter); max-width: var(--article-body-width-l); transition: padding 0s ease-in-out 0s; word-break: break-word; color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(112, 112, 112); font-size: 16px; background-color: rgb(244, 245, 247);\">Manchester United\'s 13 losses in the Premier League this season is their most in a league campaign since 1989-90 (16), while their 18 defeats in all competitions this term is their most since 1977-78 (19)</span><span style=\"background-color: rgb(244, 245, 247); color: rgb(112, 112, 112); font-size: 16px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Manchester United\'s 13 losses in the Premier League this season is their most in a league campaign since 1989-90 (16), while their 18 defeats in all competitions this term is their most since 1977-78 (19)</span><br></p>', 'Meanwhile, since the start of last season, only Nottingham Forest', '<p><span style=\"color: rgb(74, 74, 74); font-family: &quot;Sky Text&quot;, sans-serif; font-size: 22px; background-color: rgb(255, 255, 255);\">\"Manchester United\'s U23 team, if they are at Manchester United, have come through their academy, have been coached and taught to play, I would still not expect them to lose 4-0.</span><br></p>', '12,17,18', 'crystal_palace_4-0_manchester_united__premier_league_highlights.jpg', 'rystal_palace_4-0_manchester_u', 1, '2024-05-07 05:30:22', NULL);
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(14, 19, 11, 'Memories of Peace Building and Conflict Transformation', 'I facilitated peace building training in many NGOs of Bangladesh. It was a wonderful experience to talk with the local leaders,', '<p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">At Br. Guillaume’s invitation, MCCB- Peace Team Members, Niazul Islam, Kirstin De Mello, and Merwyn De Mello, participated in the Journey. It was an opportunity to enhance their learning about Bangladesh’ diversity from a faith perspective.</p><p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">The group was formed with Hindu, Muslim and Christian participants. There were persons from two ethnic groups as well. A majority of the participants were university students, some being job holders. On average 15-20 participated in each day of the four-day interfaith journey.</p><p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">different faiths is facing challenges in Bangladesh. He believes that through this journey participants will raise their awareness of diversity and embrace it in all spheres of life. Another objective of the journey is to create a movement which will support the richness of all kinds of diversity in Bangladesh and let it flourish.</p><p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><img src=\"data:image/jpeg;base64,\" data-filename=\"4k-wallpaper-android-wallpaper-bangladesh-1709022.jpg\" style=\"width: 1279.16px;\"></p><p style=\"margin-right: 0px; margin-bottom: 1.71429rem; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.71429; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">On the first day we visited several places. Samia Haq, professor of anthropology, Brac university and two of her students joined us. Several students of the Dhaka’s Catholic Seminary also joined us. We started our journey at St. Thomas church in old Dhaka town. In St Thomas Catholic church, Mr. M.N Hawladar a teacher of the Major Seminary spoke to us about the church’s history and about the catholic religion. He shared about the history of the Church and Christian society from 20 the century in Bangladesh. Next, we visited the Brahmo Samaj establishment. Brahmo Samaj was a Hindu reform movement in the 19th century.<br></p>', 'Day One, February 25th, 2018:', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">Places we visited in Old Dhaka</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">1. ST Thomas Church</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">2. Brahmo Samaj, a Hindu reform movement</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">3. Armenian Church</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">4. Mother Teresa Orphanage</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">5. Boro Katra Qawmi Madrasa</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">6. River Buriganga</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">7. Shia mosque</span><br style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgba(255, 255, 255, 0.95);\">8. Ahmadiyya Jamaat Bangladesh</span><br></p>', '2,21', 'memories_of_peace_building_and_conflict_transformation.jpg', 'emories_of_peace_building_and_', 1, '2024-05-09 21:54:53', NULL);
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `blog_desp`, `summery_title`, `sum_desp`, `tag`, `blog_image`, `slug`, `status`, `created_at`, `updated_at`) VALUES
(15, 19, 10, 'HOW TO TRAVEL IN SYLHET, BANGLADESH.', 'After visiting Dhaka for some days it was time to move on to other areas in Bangladesh. I was already in Sylhet.', '<p><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">I was expecting a quiet town when going to Sylhet but upon arrival I discovered it to be pretty busy still. Well, it is the capital of the region, so all the life around the region is centred there. One of the things that surprised me in Sylhet and in Bangladesh was the number of markets and especially</span><span style=\"font-weight: 700; color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\"> <a href=\"https://www.facebook.com/CattleMarket.Sylhet/\" target=\"_blank\" rel=\"noopener\" style=\"border: 0px; font-style: inherit; font-weight: 400; margin: 0px; padding: 0px; vertical-align: baseline; background-color: transparent; transition: all 0.2s linear 0s; box-shadow: none;\">cow markets</a></span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">, which I hadn’t seen before. Live stocks are being sold in the cities, towns and villages to regular people who just buy cows and bring them home where they butcher and cut them into suitable pieces themselves. It is actually a great way since you can be sure that you get really fresh meat.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">Since there are not many international tourists in Bangladesh it is more difficult to get around outside of the cities. I managed to score a pretty awesome deal though. I went to search for some tour agencies who could help or organise some kind of a tour for me in the surrounding areas. I literally stumbled upon </span><span style=\"font-weight: 700; color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">an agency </span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">on the 3rd floor of a business building while searching for another one. Instead of organising an expensive tour for me, the head of the agency called his cousin (</span><span style=\"border: 0px; font-size: 16px; font-weight: 700; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; background-color: rgb(245, 245, 245);\">Asad</span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">) who owned a motorbike. The cousin arrived at the office and we agreed that he will show me around for a couple of days on the back of his bike. The of</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">fer was (which I quickly agreed with) that I just </span><span style=\"border: 0px; font-size: 16px; font-weight: 700; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; background-color: rgb(245, 245, 245);\">pay for the fuel</span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\"> for the motorbike (turned out to be 1800 taka = 18 euros in total) and in the end, I can just give him some tips in the amount what I feel is right. On the same afternoon, he showed me around Sylhet city.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"natural-beauty-bangladesh.jpg\" style=\"width: 910px;\"><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\"><br></span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\"><br></span><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">General Muhammad Ataul Gani Osmani was the Commander-In-Chief of Bangladesh Forces during the Bangladesh Liberation War during 1971. The house museum is dedicated to his belongings and has many photos and information on the walls about his life. The building itself has actually been his ancestors’ home but turned into a museum by Bangladesh National Museum.</span><br></p>', 'Syed Jahan Rahmatullah Mazar', '<p><span style=\"color: rgb(0, 0, 0); font-family: Montserrat, sans-serif; font-size: 16px; background-color: rgb(245, 245, 245);\">Being really close to the city it is still far enough away to have clean, nice and refreshing air. It is a great place to come and have a rest away from the bustling city. It contains dense forest and various types of natural plants and trees (and of course wildlife).</span><br></p>', '19,20,21', 'how_to_travel_in_sylhet_bangladesh.jpg', 'ow_to_travel_in_sylhet_banglad', 1, '2024-05-09 22:04:31', '2024-05-09 22:05:09');

